export default function Projects() {
  return (
    <section id="projects" className="p-8 bg-grayish">
      <h2 className="text-2xl font-semibold mb-4">Projects</h2>
      <ul className="space-y-4 text-gray-300">
        <li><strong>WEEE Recycle:</strong> Rebuttal essay on e-waste sustainability solutions</li>
        <li><strong>Phishing Detector:</strong> Research and prototype for detecting malicious links</li>
        <li><strong>NSBE & Code Coogs Contributions:</strong> Community and mentorship involvement</li>
      </ul>
    </section>
  );
}
